import React from 'react';
import classes from './Users.module.css'

let Users = (props) => {
    return (
        <div>
            {
                props.users.map( (user)=> {
                    return  (
                        <div key={user.id}>
                        <span>
                            <div>
                                <img  src={user.imgSrc}/>
                            </div>    
                            <div>
                                    {user.followed} ? <button onClick={()=>props.follow(user.id)}>'Unfollow'</button> : 'Follow'}
                                
                            </div>
                        </span>
                        <span>
                            <span>
                                <div>{user.fullName}</div>
                                <div>{user.status}</div>
                            </span>
                            <span>
                                <div>{user.location.city}</div>
                                <div>{user.location.country}</div>
                            </span>

                        </span>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Users;
